import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h1>Rachel Perez Portfolio</h1>
      <nav class="navbar">
      <div class="hamburger">&#9776;</div> 
       <ul class="menu">
          <li>Home</li>
          <li>Portfolio</li>
          <li>About Me</li>
          <li>Contact Me</li>
        </ul> 
    </nav>

      </header>
    </div>
  );
}

export default App;
